import React from 'react'
import '../../index.css'
import c from './Header.module.css'

const Header = () => {

    return (
        <header className={c.header}>
            <img src='https://www.freelogodesign.org/Content/img/logo-samples/bakary.png' alt='logo'/>
            <div></div>
        </header>
    )
}

export default Header
